import logo from './logo.svg';
import './App.css';
import {Form} from './Form.js';
import React from 'react';
import { BrowserRouter, Routes, Route } from "react-router-dom";


export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Form />}/>
      </Routes>
    </BrowserRouter>
  );
}
